import './App.css';
import React from 'react';
import Layout from './components/Layout/Layout';
import { BrowserRouter as Router,
Route,
Routes } from 'react-router-dom';
import Navbar from './components/Navbar';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/contact' element={<Navbar/>} />
        </Routes>
      </Router>
     <Layout/>
    </div>
  );
}

export default App;
